import React, { useEffect, useState } from 'react';
import { AreaChart, Area, CartesianGrid, XAxis, YAxis, Tooltip, Legend, ResponsiveContainer, PieChart, Pie, Cell, BarChart, Bar } from 'recharts';
import { Package, TrendingDown, AlertTriangle, BarChart3 } from 'lucide-react';
import Card from '../components/Card';
import StatCard from '../components/StatCard';
import LoadingSpinner from '../components/LoadingSpinner';

const Dashboard = () => {
  const [stats, setStats] = useState(null);
  const [analytics, setAnalytics] = useState(null);
  const [loading, setLoading] = useState(true);

  const COLORS = ['#3B82F6', '#10B981', '#F59E0B', '#EF4444', '#8B5CF6'];

  useEffect(() => {
    const fetchData = async () => {
      await new Promise(res => setTimeout(res, 500));
      setStats({
        totalOrders: 12847,
        totalReturns: 1923,
        predictedReturns: 486,
        returnRate: 14.97
      });

      setAnalytics({
        returnReasons: [
          { name: 'Defective Product', value: 35 },
          { name: 'Wrong Size/Color', value: 28 },
          { name: 'Not as Described', value: 18 },
          { name: 'Damaged in Transit', value: 12 },
          { name: 'Changed Mind', value: 7 }
        ],
        monthlyTrends: [
          { month: 'Jan', returns: 156, orders: 1200 },
          { month: 'Feb', returns: 189, orders: 1350 },
          { month: 'Mar', returns: 234, orders: 1450 },
          { month: 'Apr', returns: 198, orders: 1380 },
          { month: 'May', returns: 267, orders: 1520 },
          { month: 'Jun', returns: 289, orders: 1650 }
        ],
        riskDistribution: [
          { range: '0-20%', count: 45 },
          { range: '21-40%', count: 32 },
          { range: '41-60%', count: 28 },
          { range: '61-80%', count: 18 },
          { range: '81-100%', count: 12 }
        ]
      });

      setLoading(false);
    };
    fetchData();
  }, []);

  if (loading) return <LoadingSpinner />;

  return (
    <div className="page-container">
      <div className="stats-grid">
        <StatCard title="Total Orders" value={stats.totalOrders} icon={Package} color="blue" trend={8.2} />
        <StatCard title="Total Returns" value={stats.totalReturns} icon={TrendingDown} color="red" trend={-2.4} />
        <StatCard title="Predicted Returns" value={stats.predictedReturns} icon={AlertTriangle} color="yellow" trend={5.1} />
        <StatCard title="Return Rate" value={`${stats.returnRate}%`} icon={BarChart3} color="green" trend={-1.3} />
      </div>

      <div className="charts-grid">
        <Card title="Monthly Return Trends">
          <ResponsiveContainer width="100%" height={300}>
            <AreaChart data={analytics.monthlyTrends}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="month" />
              <YAxis />
              <Tooltip />
              <Legend />
              <Area type="monotone" dataKey="returns" stackId="1" stroke="#EF4444" fill="#FEE2E2" />
              <Area type="monotone" dataKey="orders" stackId="2" stroke="#3B82F6" fill="#DBEAFE" />
            </AreaChart>
          </ResponsiveContainer>
        </Card>

        <Card title="Return Reasons Breakdown">
          <ResponsiveContainer width="100%" height={300}>
            <PieChart>
              <Pie data={analytics.returnReasons} cx="50%" cy="50%" labelLine={false} outerRadius={80} dataKey="value">
                {analytics.returnReasons.map((entry, index) => (
                  <Cell key={index} fill={COLORS[index % COLORS.length]} />
                ))}
              </Pie>
              <Tooltip />
            </PieChart>
          </ResponsiveContainer>
        </Card>
      </div>

      <Card title="Return Risk Distribution">
        <ResponsiveContainer width="100%" height={300}>
          <BarChart data={analytics.riskDistribution}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis dataKey="range" />
            <YAxis />
            <Tooltip />
            <Bar dataKey="count" fill="#3B82F6" />
          </BarChart>
        </ResponsiveContainer>
      </Card>
    </div>
  );
};

export default Dashboard;
